must be reviewed before being displayed on this page." /><img id="mw-fr-revisiontoggle" class="fr-toggle-arrow" src="/w/extensions/FlaggedRevs/frontend/modules/img/arrow-down.png" style="display:none;" alt="show/hide details" /></div> <div id="mw-fr-revisiondetails-wrapper" style="position:relative;"><div id="mw-fr-revisiondetails" class="flaggedrevs_short_details" style="display:none">This is the <a href="/wiki/Wikipedia:Pending_changes" title="Wikipedia:Pending changes">latest accepted revision</a>, <a class="external text" href="//en.wikipedia.org/w/index.php?title=Special:Log&amp;type=review&amp;page=Seal">reviewed</a> on <i>30 December 2017</i>.</div> </div> </div> </div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><table role="presentation" class="mbox-small plainlinks sistersitebox" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/seal" class="extiw" title="wiktionary:seal">seal</a></b></i>&#160;or <i><b><a href="https://en.wiktionary.org/wiki/SEAL" class="extiw" title="wiktionary:SEAL">SEAL</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <p><b>Seal</b> most commonly refers to:</p> <ul> <li><a href="/wiki/Pinniped" title="Pinniped">Pinniped</a>, a diverse group of semi-aquatic marine mammals, many of which are commonly called seals, particularly: <ul> <li><a href="/wiki/Earless_seals" class="mw-redirect" title="Earless seals">Earless seals</a> or "true seals"</li> <li><a href="/wiki/Fur_seals" class="mw-redirect" title="Fur seals">Fur seals</a></li> </ul> </li> <li><a href="/wiki/Seal_(emblem)" title="Seal (emblem)">Seal (emblem)</a>, an emblem used as a means of authentication; both an impression in paper, wax, clay or other medium, and the device used</li> <li><a href="/wiki/Seal_(mechanical)" title="Seal (mechanical)">Seal (mechanical)</a>, a device which helps prevent leakage, contain pressure, or exclude contamination where two systems join</li> <li><a href="/wiki/Seal_(surname)" title="Seal (surname)">Seal (surname)</a>, an Indian surname of Hindu Bengalis and Rajputs</li> </ul> <p><b>Seal</b> may also refer to:</p> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Arts_and_entertainment"><span class="tocnumber">1</span> <span class="toctext">Arts and entertainment</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Law"><span class="tocnumber">2</span> <span class="toctext">Law</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#Military"><span class="tocnumber">3</span> <span class="toctext">Military</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#People"><span class="tocnumber">4</span> <span class="toctext">People</span></a></li> <li class="toclevel-1 tocsection-5"><a href="#Places"><span class="tocnumber">5</span> <span class="toctext">Places</span></a></li> <li class="toclevel-1 tocsection-6"><a href="#Other"><span class="tocnumber">6</span> <span class="toctext">Other</span></a></li> <li class="toclevel-1 tocsection-7"><a href="#See_also"><span class="tocnumber">7</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="Arts_and_entertainment">Arts and entertainment</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Seal&amp;action=edit&amp;section=1" title="Edit section: Arts and entertainment">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Seal_(musician)" title="Seal (musician)">Seal (musician)</a>, English singer and songwriter, or any of his three self-titled albums: <ul> <li><a href="/wiki/Seal_(1991_album)" title="Seal (1991 album)"><i>Seal</i> (1991 album)</a></li> <li><a href="/wiki/Seal_(1994_album)" title="Seal (1994 album)"><i>Seal</i> (1994 album)</a>, sometimes referred to as <i>Seal II</i></li> <li><a href="/wiki/Seal_(2003_album)" class="mw-redirect" title="Seal (2003 album)"><i>Seal</i> (2003 album)</a>, sometimes referred to as <i>Seal IV</i> (following his third album <i>Human Being</i>)</li> </ul> </li> <li><i><a href="/wiki/Seal_Online" title="Seal Online">Seal Online</a></i>, a massively multiplayer online role-playing game</li> </ul> <h2><span class="mw-headline" id="Law">Law</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Seal&amp;action=edit&amp;section=2" title="Edit section: Law">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Record_sealing" title="Record sealing">Record sealing</a></li> <li><a href="/wiki/Seal_(contract_law)" title="Seal (contract law)">Seal (contract law)</a>, a legal formality for contracts and other instruments</li> <li><a href="/wiki/Seal_(East_Asia)" title="Seal (East Asia)">Seal (East Asia)</a>, a stamp used in East Asia as a form of a signature</li> </ul> <h2><span class="mw-headline" id="Military">Military</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Seal&amp;action=edit&amp;section=3" title="Edit section: Military">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><i><a href="/wiki/Fairey_Seal" title="Fairey Seal">Fairey Seal</a></i>, a 1930s British carrier-borne torpedo bomber aircraft</li> <li><a href="/wiki/HMS_Seal" title="HMS Seal">HMS <i>Seal</i></a>, two Royal Navy ships and one submarine</li> <li><a href="/wiki/USS_Seal" title="USS Seal">USS <i>Seal</i></a>, two American submarines</li> </ul> <dl> <dt>Special forces</dt> </dl> <ul> <li><a href="/wiki/United_States_Navy_SEALs" title="United States Navy SEALs">United States Navy SEALs</a>, the principal special operations force of the U.S. Navy</li> <li><a href="/wiki/Royal_Thai_Navy_SEALs" class="mw-redirect" title="Royal Thai Navy SEALs">Royal Thai Navy SEALs</a>, Thai Navy special operations force modelled on the U.S. unit</li> <li>'<a href="/wiki/Naval_Special_Operations_Group" title="Naval Special Operations Group">Naval Special Operations Group</a> also known as the Philippine Navy SEALs</li> <li>ROKN UDT/SEALs, a component of the <a href="/wiki/Republic_of_Korea_Navy_Special_Warfare_Flotilla" title="Republic of Korea Navy Special Warfare Flotilla">Republic of Korea Navy Special Warfare Flotilla</a></li> </ul> <h2><span class="mw-headline" id="People">People</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Seal&amp;action=edit&amp;section=4" title="Edit section: People">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Seal_(musician)" title="Seal (musician)">Seal (musician)</a>, English singer and songwriter</li> <li><a href="/wiki/Aditya_Seal" title="Aditya Seal">Aditya Seal</a> (born 1988), Indian actor</li> <li><a href="/wiki/Barry_Seal" title="Barry Seal">Barry Seal</a> (1939–1986), American drug smuggler and DEA informant</li> <li><a href="/wiki/Brajendra_Nath_Seal" title="Brajendra Nath Seal">Brajendra Nath Seal</a> (1864–1938), Indian humanist philosopher and educator</li> <li><a href="/wiki/David_Seal" title="David Seal">David Seal</a> (born 1972), Australian soccer player</li> <li><a href="/wiki/Elizabeth_Seal" title="Elizabeth Seal">Elizabeth Seal</a> (born 1933), Italian actress</li> <li><a href="/wiki/Frances_Thurber_Seal" title="Frances Thurber Seal">Frances Thurber Seal</a>, American Christian Science practitioner and teacher</li> <li><a href="/wiki/Jaynie_Seal" title="Jaynie Seal">Jaynie Seal</a> (born 1973), Australian television presenter</li> <li><a href="/wiki/Jimmy_Seal" title="Jimmy Seal">Jimmy Seal</a> (born 1950), English footballer</li> <li><a href="/wiki/Kevin_Seal" title="Kevin Seal">Kevin Seal</a>, MTV VJ in the late 1980s, the host of the pilot of Club MTV</li> <li><a href="/wiki/Manuel_Seal,_Jr." class="mw-redirect" title="Manuel Seal, Jr.">Manuel Seal, Jr.</a>, American songwriter-producer</li> <li><a href="/wiki/Mike_Seal" class="mw-redirect" title="Mike Seal">Mike Seal</a> (born 1970), Assistant Conductor of the City of Birmingham Symphony Orchestra</li> <li><a href="/wiki/Mike_Seal_(fighter)" title="Mike Seal (fighter)">Mike Seal (fighter)</a> (born 1977), Mexican mixed martial artist</li> <li><a href="/wiki/Mutty_Lall_Seal" title="Mutty Lall Seal">Mutty Lall Seal</a> (1792–1854), Bengali Indian businessman and philanthropist</li> <li><a href="/wiki/Paul_Seal" title="Paul Seal">Paul Seal</a> (born 1952), former American football tight end in the National Football League</li> <li><a href="/wiki/Seal_(musician)" title="Seal (musician)">Seal (musician)</a> (born 1963), British soul and R&amp;B singer-songwriter</li> <li><a href="/wiki/Sudhangshu_Seal" title="Sudhangshu Seal">Sudhangshu Seal</a> (born 1945), member of the 14th Lok Sabha of India</li> <li><a href="/wiki/Tong_Seal" title="Tong Seal">Tong Seal</a> (born 1346), legendary Burmese ruler</li> </ul> <h2><span class="mw-headline" id="Places">Places</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Seal&amp;action=edit&amp;section=5" title="Edit section: Places">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Seal,_Kent" title="Seal, Kent">Seal, Kent</a>, a village and civil parish in England</li> <li><a href="/wiki/Seal,_Ohio" title="Seal, Ohio">Seal, Ohio</a>, an unincorporated community</li> <li><a href="/wiki/Seal_Beach,_California" title="Seal Beach, California">Seal Beach, California</a>, a city located in Orange County, USA</li> <li><a href="/wiki/Seal_Harbour,_Nova_Scotia" title="Seal Harbour, Nova Scotia">Seal Harbour, Nova Scotia</a>, a community in Guysborough County, Canada</li> <li><a href="/wiki/Seal_Cay" title="Seal Cay">Seal Cay</a>, а island within the Bahamas</li> </ul> <h2><span class="mw-headline" id="Other">Other</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Seal&amp;action=edit&amp;section=6" title="Edit section: Other">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Digital_Signature_And_Electronic_Authentication_Law" class="mw-redirect" title="Digital Signature And Electronic Authentication Law">Digital Signature And Electronic Authentication Law</a> (SEAL), a bill that sought to update banking regulations in the US</li> <li><a href="/wiki/Seal_of_the_prophets" class="mw-redirect" title="Seal of the prophets">Seal of the prophets</a>, a title given to the Islamic prophet, Muhammad</li> <li><a href="/wiki/Seal_script" title="Seal script">Seal script</a>, ancient Chinese calligraphy</li> <li><a href="/wiki/Security_seal" title="Security seal">Security seal</a>, a device used to show whether a locking device has been opened</li> <li>"Seal", a generic term for the surface treatment of <a href="/wiki/Sealed_road" title="Sealed road">sealed roads</a> (and by extension, a term used for the roads themselves)</li> <li>the black coat color of <a href="/wiki/Point_c